const TodoDetails = ({todo}) => {
    return ( 
        <div className="todo-details"> 
            <h4>{todo.title}</h4>
            <p><strong>Details: </strong>{todo.details}</p>
            <p>{todo.createdAt}</p>
        </div>
     );
}
 
export default TodoDetails;
